import {Link} from 'react-router-dom';

function Header() {

    return (
      <div className="App">
        <h1>
          This is where all the links go
          <Link to="/">Home</Link>
          <Link to="/clothing">Clothing</Link>
          <Link to="/shoes">Shoes</Link>
          <Link to="/new-contact">New Contact</Link>
        </h1>

      </div>
    );
  }

  export default Header;
